import React from 'react';
import UserList from './components/UserList';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT3MF3cDnJ_3rdSjWqhVTsZQR2kyE00zL9oEsCK_XDcpbtt9c_g8ApL&usqp=CAE&s" alt="Company Logo" className="logo" />
        <h1>Employees</h1>
        <div className="filter-icons">
          {/* Add filter icon logic */}
        </div>
      </header>
      <UserList />
    </div>
  );
}

export default App;
